import React from 'React';
import {Line} from 'chart.js'; 
import CovidTrackerService from '../services/CovidTrackerService';

class CovidTrackerComponent extends React.Component {
    constructor() {
        this.state = {
            country: [] 
        }
    }

    componentDidMount() {
        CovidTrackerService.getData().then((resp)=>{
            this.setState({country: resp.data})
        });
    }

    render() {
        return (
            <div>
                <h1> Data </h1>
                <table>
                    <thead>
                        <tr>
                            <td> Name</td>
                            <td> Code</td>
                            <td> Population </td>
                            <td> Latest Data </td>
                            <td> Timeline </td>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.country.map(
                                country =>
                                <tr key = {country.code}>
                                    <td>{country.name}</td>
                                    <td>{country.code}</td>
                                    <td>{country.population}</td>
                                    <td>{country.latest_data}</td>
                                    <td>{country.timeline}</td>
                                </tr>
                            )
                        }
                    </tbody>
                </table>
            </div>
        )
    }
}

export default CovidTrackerComponent
